INSERT INTO `battle_pet_species_locale` (`ID`, `locale`, `Description_lang`, `SourceText_lang`, `VerifiedBuild`) VALUES
(4728, 'zhTW', '在度過漫長又慵懶的一天後，米克西茶簇小熊貓馴寵師最愛與牠們的茶簇小熊貓悠閒度日，並喝上一杯神秘茶水。', '|cFFFFD200貿易站|r', 58238),
(4542, 'zhTW', '雖然能讓寇拜斯飽餐一頓，但牠們也能成為冒險者的最佳夥伴。', '|cFFFFD200任務：|r霸氣的解決方案|n|cFFFFD200區域：|r阿茲-卡罕特', 58238);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(278296, 'zhTW', '<馬馬杜渴望地看著你。>', '', 58238),
(278176, 'zhTW', '<馬馬杜充滿期待地看著你。>', '', 58238),
(11145, 'zhTW', '', '這個時代的星星在全新的軌跡之中誕生，成了希望的信標，以及未來力量的泉源。', 58238),
(279769, 'zhTW', '再次航向空中感覺真棒！\n\n自從和卡博克蘭一起罷工之後，就一直找不到這種感覺。她的合作對象從來不付錢給我們任何人...連她自己也拿不到錢！她索性也不跑公主號了，之後我們各奔東西，就這樣持續了好一陣子。\n\n現在我們回到這裡，準備航向天際！嘿！\n\n度烏納就不那麼有熱血激昂了。她相當畏懼「伯昂圖拉克」，我也不怪她。\n\n我們會直接駛進風暴。在風暴裡，杉戈會庇佑我們的！', '', 58238),
(279768, 'zhTW', '', '你要去海妖島？\n\n<度烏納的嘴角和獠牙扭曲了起來，接著吐了一口口水。>\n\n我對卡博克蘭說過，這是一個凶兆。我曾耳聞關於海妖的故事。我們的贊達拉語稱她們作「伯昂圖拉克」，代表「死亡歌唱者」。她們是可怕的生物。\n\n我從來沒有在任何一次航行中撞見過她們，我想應該是自己十分走運吧。現在，我們卻要前往一個以她們為名的地方？\n\n<度烏納欠下了身並搖了搖頭。>\n\n願杉戈賜予我們一路順風。', 58238),
(279747, 'zhTW', '不幸的是，幾乎一無所知。我派出精銳，看看他們能發掘出什麼。\n\n他們發掘到的不多，只有一些波拉勒斯的故事。我們所能找到的最古老紀錄，是某個庫爾提拉斯寓言之類的東西，警告「呼喚」相當危險，天知道那個呼喚是什麼。\n\n我們找不到地圖之類的東西，感覺是個大多數人避之唯恐不及的地方，但我覺得是個機會！\n\n幸好瑞基特和我派的人提供給我們充分的資料，讓我們能找到回來的路。', '', 58238),
(278425, 'zhTW', '你和卡茲阿爾加一半的人都想知道！\n\n一開始，阿拉希人和土靈都在問它的事，接著他們就一窩蜂地衝進飛船和鑽地機！\n\n喔，如果我的火箭鑽頭接點還在，我敢打賭，我們能更快抵達那裡！\n\n不過，既然你都問了。\n\n我們要前往海妖島。有聽過嗎？', '', 58238),
(273289, 'zhTW', '嘿，歡迎登船！土靈和阿拉希人已經在島上了。我們得跟上去！', '', 58238),
(273102, 'zhTW', '看吧？我們遲到了。來下面找我。還有注意你的腳下！嘿嘿嘿。', '', 58238);
